import Principal from "./Principal";
import Foooter from "./Foooter";
import "bootstrap/dist/css/bootstrap.min.css";
import BotonFace from "./BotonFace";

function App() {
  return (
    <div className="App">
      <Header></Header>
      <Principal />
      <BotonFace></BotonFace>
      <BotonFace></BotonFace>
      <BotonFace></BotonFace>
      <BotonFace></BotonFace>
      <BotonFace></BotonFace>
      <BotonFace></BotonFace>
      <Foooter></Foooter>
    </div>
  );
}

export default App;
